import { useForm } from "react-hook-form";

function Formulaire() {
  const { register, handleSubmit, watch, formState: { errors } } = useForm();
//   const onSubmit = data => console.log(data);
  const onSubmit = async (data) => {
    const requestOptions = {
        mode: 'no-cors',
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify(data)
    };

    console.log(data);

    const response = await fetch(["http://localhost:8000/api/inscription"], requestOptions);
    const jsonData = await response.json();

    console.log(jsonData);
};

  console.log(watch("example")); // watch input value by passing the name of it

  return (
    /* "handleSubmit" will validate your inputs before invoking "onSubmit" */
    <form onSubmit={handleSubmit(onSubmit)}>
      {/* register your input into the hook by invoking the "register" function */}
      {/* <input defaultValue="test" {...register("example")} /> */}
             <label for="nom">Votre nom :</label>
             <input type="text" name="nom" id="nom"  {...register("nom")} />
             <br/>
             <label for="prenom">Votre prénom :</label>
             <input type="text"  name="prenom" id="prenom"  {...register("prenom")} />
             <br/>
             <label for="username">username:</label>
             <input type="username"  name="username" id="username"  {...register("username")} />
             <br/>
             <label for="taille_cm">Votre taille :</label>
             <input type="number"  name="taille_cm" id="taille_cm"  {...register("taille_cm")} />cm
             <br/>
             <label for="poids">Votre poids :</label>
             <input type="number"  name="poids" id="poids"  {...register("poids")} />kg
             <br/>
             <label for="age">Votre âge :</label>
             <input type="number" name="age" id="age"  {...register("age")} />age
             <br/>
             <label for="sexe">Votre âge :</label>
             <input type="text" name="sexe" id="sexe"  {...register("sexe")} />sexe
             <br/>
             <label for="frequence_sport">Votre frequence de sport par semaine (en jours) :</label>
             <input type="text"  name="frequence_sport" id="frequence_sport" {...register("frequence_sport")} />
             <br/>
             <label for="password">Votre mot de passe :</label>
             <input type="password"  name="password" id="password"  {...register("password")} />
             <br/>
             <label for="password2">Confirmer votre mot de passe :</label>
             <input type="password"  name="password2" id="password2"  {...register("password2")} />
             <br/>
      
      
      {/* include validation with required or other standard HTML validation rules */}
      <input {...register("exampleRequired", { required: true })} />
      {/* errors will return when field validation fails  */}
      {errors.exampleRequired && <span>This field is required</span>}
      
      <input type="submit" />
    </form>
  );
}

